import React, {Component} from 'react';
import {Formik} from 'formik';
import FormItem from 'components/FormItem';
import Button from 'components/Button';
import styled from 'styled-components';

const FilterContainer = styled.div`
    display:flex;
    flex-direction: row;
`;

const StyledFilterItem = styled.input`
    border: none;
    display: flex;
    width: 200px;
    height: 20px;
`


class Filter extends Component {
    constructor(){
        super();
        this.state = {
            startTime: '00:00:00',
            endTime: '23:59:59',
            startDate: '1900-01-01',
            endDate: '2090-01-01'
        }
    }

    render() {
        return <Formik
            initialValues={this.state}
            >
            <FilterContainer>
                <StyledFilterItem/>
                <StyledFilterItem/>
                <StyledFilterItem/>
                <StyledFilterItem/>
                <Button value='Filter' type='submit'/>
            </FilterContainer>

            </Formik>
    }
}

export default Filter;
